import React from 'react';
import { Link } from 'react-router-dom';

function Danhmuc(props) {
    let { danhmuc } = props;
    return (
        <div className="col-md-3" style={{ marginRight: "-15px" }}>
            {/* CATEGORIES */}
            <div className="categorycontent">
                {danhmuc.map((item) => {
                    return (
                        <ul>
                            <li>
                                <Link to="sach-kinh-te.html"> Sách Kinh Tế - Kỹ Năng</Link>
                                <i className="fa fa-chevron-right float-right" />
                                <ul>
                                    <li className="liheader">
                                        <Link to="#" className="header text-uppercase">
                                            Sách Kinh Tế - Kỹ Năng
                                        </Link>
                                    </li>
                                    <div className="content trai">
                                        <li>
                                            <Link to="#">Kinh Tế - Chính Trị</Link>
                                        </li>
                                    </div>
                                    <div className="content phai">
                                        <li>
                                            <Link to="#">Nhân Vật - Bài Học Kinh Doanh</Link>
                                        </li>
                                    </div>
                                </ul>
                            </li>

                        </ul>


                    )
                })}


            </div>
        </div>


    )
}

export default Danhmuc
